import React from "react";

import { connect } from "react-redux";

import { addTask } from "../actions/TasksActions";

const AddTask = (props) => {
  let _title = props.path;

  return (
    <div>
      {connect(null, { add: addTask })(AddTask)}
    </div>
  );
};
